import pig from './images/PiggyBank.png'


function Landing() {
    return (
        <div className='text-center'>
            <figure className="figure text-center">
            <h1>"Welcome to The Budget Pig</h1>
                <img src={pig} className="figure-img img-fluid text-center pig" alt="pig logo"></img>
            </figure>
        </div>
    )
}





export default Landing;
